.location-mine, .loc-details-full {
  	background: url("/images/locationbg.jpg") repeat scroll 0 0 transparent;
	border-radius: 12px 12px 12px 12px;
	-webkit-box-shadow: 0 0 10px #000000;
	box-shadow: 0 0 10px #000000;
	color: #FFFFFF;
	font-family: Arial,Helvetica,sans-serif;
	font-size: 13px;
	line-height: 14px;
	margin: 0 15px 10px 0;
	padding: 15px;
}
.location-image img {
	border:2px solid #F9EF05;
}
.location-details, .loc-details-contact {
	margin-left:25px;
}
.location-title, .loc-details-title {
	font-family:CooperStdBlack,Arial,Helvetica,sans-serif;
	font-size:25px;
	color: #F9EF05;
}
.location-intro {
	margin-bottom:25px;
}
.location-inner, .loc-details-contact {
  color: #fff;
  font-family: HelveticaCondensedMediumRg,Arial,Helvetica,sans-serif;
  font-size: 14px;
  font-weight: bold;
  line-height: normal;
  position: relative;
}
.location-hours {
	margin:25px 0 10px 0;
}

.another-loc #srchLoc_q{
	color: #666666;
	font-size: 11px;
	padding: 4px;
	width: 126px;
}
.another-loc {
	padding-top:10px;
}
.other-location-cont {
	background: url("/images/locationbg.jpg") repeat scroll 0 0 transparent;
	box-shadow: 0 0 2px #666666;
	float: left;
	margin: 14px 10px 0 0;
	padding:11px 5px 11px 11px;
	position: relative;
	width: 29%;
	border: 1px solid #ccc;
	color:#fff;
	font-size:13px;
	min-height: 160px;
	border-radius: 12px 12px 12px 12px;
}
.other-location-cont.tall {
	position: relative;
}

.other-location-cont.tall .view-more {
  float: none !important;
  margin: 10px 0 5px;
  text-align: left;
  width: 100% !important;
}
.other-location-title {
  display: block;
  color: #F9EF05;
  font-family: CooperStdBlack,Arial,Helvetica,sans-serif;
  font-size: 19px;
  line-height: 24px;
  margin-bottom: 3px;
  float:left;
}
.view-more.top-right {
  position: absolute;
  right: 2px;
  top: 7px;
}
.mapit, .viewmore {
	background:url(/images/iconsprite.png) no-repeat;
  display: block;
  float: left;
  height: 27px;
  margin-right: 5px;
  text-indent: -9999px;
  width: 27px;
}
.mapit {
	background-position:-35px 0;
}
.viewmore {
	background-position:0 0;
}
.mapit:hover {
	background-position:-35px -40px;
}
.viewmore:hover {
	background-position:0 -40px;
}
.loc-details-title {
	line-height:25px;
	margin-bottom:10px;
}
.loc-promo {
	float:left;
}
.location-nav {
	margin-top: 10px;
	padding: 5px;
	width: 40% !important;
}
.location-nav li {
	float:left;
}
.location-nav li a {
  color: #015097;
  display: block;
  padding: 5px 10px;
  text-align: center;
  width: 130px;
}
.loc-details-contact, .location-details {
	width: 35%;
}
.lsprite {
	background:url(/images/loc-sprite.png) no-repeat;
	display: block;
	padding-left:35px;
	width:0;
}

.square-icon { background:url(/images/loc-sprite-4square.png) no-repeat; height: 35px; }
.slider:hover .square-icon { background-position: left bottom; }

.twitter2-icon { background:url(/images/loc-sprite-4square.png) no-repeat; height: 35px; }
.slider:hover .twitter2-icon { background-position: left bottom; }

.twitter-icon { background:url(/images/loc-sprite-twitter.png) no-repeat; height: 35px; }
.slider:hover .twitter-icon { background-position: left bottom; }



.micon {
    background-position: -123px 1px;
    height: 34px;
}
.picon {
    background-position: -62px 1px;
    height: 35px;
}
.ficon {
    background-position: left 1px;
    height: 35px;
    margin-left: 3px;
}
.iicon {
    background-position: -280px 1px;
}
.dicon {
    background-position: -234px 1px;
}
.eicon {
  background-position: -177px 1px;
}
.oicon {
  background-position: -329px 1px;
}
.slider:hover .micon {
	background-position: -123px -39px;
}
.slider:hover .picon {
	background-position: -62px -39px;
}
.slider:hover .dicon {
	background-position: -234px -37px;
}
.slider:hover .iicon {
	background-position: -280px -37px;
}
.slider:hover .ficon {
	background-position:left -39px;
}
.slider:hover .eicon {
	background-position:-177px -37px;
}
.slider:hover .oicon {
	background-position:-329px -37px;
}
.loc-actions {
	width:18%;
}
.loc-actions a {
	margin-bottom:8px;
}
.loc-actions > a > span {
	width:100px;
}
.title{
	font-family: 'HelveticaCondensedMediumRg';
	font-size: 20px;
	font-weight:bold;
	color: #ed1c2b;
	line-height: 24px;
	padding-top:8px;
}
.other-title {
	width: 97%;
	margin: 25px 0 0 0;
}
.next-five {
	margin-top:10px;
}.address {
font-size: .9em;
}

